import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 23.1-2201 Membership.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-2201.md","filePath":"vacode/23.1-2201.md"}'),i={name:"vacode/23.1-2201.md"},o=t('<h1 id="§-23-1-2201-membership" tabindex="-1">§ 23.1-2201 Membership. <a class="header-anchor" href="#§-23-1-2201-membership" aria-label="Permalink to &quot;§ 23.1-2201 Membership.&quot;">​</a></h1><p>A. The board shall consist of 17 members appointed by the Governor, of whom at least (i) 12 shall be appointed from the Commonwealth at large, (ii) 12 shall be alumni of the University, and (iii) one shall be a physician with administrative and clinical experience in an academic medical center.</p><p>B. The alumni association of the University may submit to the Governor a list of at least three nominees for each vacancy on the board, whether the vacancy occurs by expiration of a term or otherwise. The Governor may appoint members from the list of nominees.</p><p>Code 1919, § 807, §§ 23-70, 23-71; 1924, p. 145; 1930, p. 80; 1944, pp. 399, 400; 1945, p. 52; 1954, c. 343; 1980, c. 559; 1989, Sp. Sess., c. 5; 2008, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0055" target="_blank" rel="noreferrer">55</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0155" target="_blank" rel="noreferrer">155</a>; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0599" target="_blank" rel="noreferrer">599</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),n=[o];function s(c,l,h,p,m,_){return a(),r("div",null,n)}const b=e(i,[["render",s]]);export{d as __pageData,b as default};
